import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <header>
      <div className="container">
        <Link to="/">
          <h1>Workout Buddy</h1>
        </Link>
        <nav>
          <div>
            <button>Logout</button>
          </div>
          <div>
            <Link to="/login">Login</Link>
            <Link to="/signup">sign Up</Link>
          </div>
        </nav>
      </div>
    </header>
  );
};

export default Navbar;
